 sans-serif; text-align: justify;&quot;&gt;7-25g&lt;/strong&gt;&amp;nbsp;Jigging Performance - удобное лодочное удилище с классическим быстрым строем, отменно работает с малыми весами. Рекомендовано рыболовам, которые предпочитают тонкую ловлю на джиг. Удилище отлично сбалансировано и обладает ультра чувствительностью.&lt;/p&gt;\n&lt;p&gt;\n	VIRTUOSO Jigging Performance - серия из четырех удилищ для джиговой ловли, при создании которых использовалась технология &ldquo;Slim Blank&rdquo;. Благодаря непревзойденной чувствительности, они способны отслеживать рельеф дна даже на больших глубинах при наличии значительного течения. Тонкий, жёсткий, мощный бланк каждой из них способен заставить приманку покрывать предельные дистанции.&lt;/p&gt;\n','','',''),(776,2,'Спиннинг EXTREME VOLANT OBSESSION 902MH','&lt;p&gt;\n	Спиннинг EXTREME VOLANT OBSESSION 902MH&lt;/p&gt;\n&lt;p&gt;\n	VIRTUOSO OBSESSION 862ML&amp;nbsp;&lt;strong style=&quot;color: rgb(46, 66, 76); font-family: Arial, Helvetica, sans-serif; text-align: justify;&quot;&gt;7-27g&lt;/strong&gt;&amp;nbsp;Jigging Performance - удобное лодочное удилище с классическим быстрым строем, отменно работает с малыми весами. Рекомендовано рыболовам, которые предпочитают тонкую ловлю на джиг. Удилище отлично сбалансировано и обладает ультра чувствительностью.&lt;/p&gt;\n','','',''),(772,2,'Спиннинг EXTREME FISHING PANACHE  PASSION 742M','&lt;p&gt;\n	Спиннинг EXTREME FISHING PANACHE PASSION 742M&lt;/p&gt;\n&lt;p&gt;\n	Отличное ультра универсальное удилище для вращающихся и колеблющихся блесен. Серия, которая позволит приобщить к рыбалке интересующихся и превратить их в заядлых рыболовов.&lt;/p&gt;\n&lt;p&gt;\n	&amp;nbsp;&lt;/p&gt;\n&lt;p&gt;\n	&amp;nbsp;&lt;/p&gt;\n&lt;table cellpadding=&quot;3&quot; cellspacing=&quot;0&quot;&gt;\n	&lt;tbody&gt;\n		&lt;tr&gt;\n			&lt;td align=&quot;left&quot; style=&quot; font-size:10pt;&quot; valign=&quot;bottom&quot;&gt;\n				Длина&lt;/td&gt;\n			&lt;td align=&quot;left&quot; style=&quot; font-si