&quot;row0&quot; height=&quot;18&quot;&gt;\n			&lt;td width=&quot;30%&quot;&gt;\n				Кол колец&lt;/td&gt;\n			&lt;td&gt;\n				&amp;nbsp;&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr class=&quot;row1&quot; height=&quot;18&quot;&gt;\n			&lt;td width=&quot;30%&quot;&gt;\n				Кол секций&lt;/td&gt;\n			&lt;td&gt;\n				2&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr class=&quot;row0&quot; height=&quot;18&quot;&gt;\n			&lt;td width=&quot;30%&quot;&gt;\n				Тест min&lt;/td&gt;\n			&lt;td&gt;\n				1&lt;/td&gt;\n		&lt;/tr&gt;\n		&lt;tr class=&quot;row1&quot; height=&quot;18&quot;&gt;\n			&lt;td width=&quot;30%&quot;&gt;\n				Тест max&lt;/td&gt;\n			&lt;td&gt;\n				8&lt;/td&gt;\n		&lt;/tr&gt;\n	&lt;/tbody&gt;\n&lt;/table&gt;\n&lt;p&gt;\n	&amp;nbsp;&lt;/p&gt;\n','','',''),(738,2,'Спиннинг EOS Hunter 1.5 (100-200)','&lt;p&gt;\n	&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;span style=&quot;font-family: Arial; font-size: small; line-height: 1.4; color: rgb(23, 20, 17);&quot;&gt;Эти удилища далеки от образцов &quot;современного удилищестроения&quot;, которые порой пытаются выдавать как сверхбыстрые лишь только потому, что по сути они представляют собой почти негнущуюся дубину. Mega - это упругость и быстрота реакции на изменение нагрузки, без которых &quot;быстрый&quot; строй просто теряет смысл. Благодаря конструкции бланка, качеству используемых графитовых материалов и оснастке кольцами Fuji&reg; New Concept Alconite&reg;, достигнуто сбалансированное распределение нагрузки в процессе работы удилища, соответствующее именно быстрому строю. Это обеспечивает точный и дальний заброс, мощность при подсечке, надежность при вываживании и, что особенно важно, исключает то ощущение дискомфорта и усталости, которое порой заставляет отложить в сторону гораздо более дорогое удилище, казавшееся столь многообещающим в магазине.&lt;/span&gt;&lt;/p&gt;\n&lt;p style=&quot;line-height: 1.4; font-family: Tahoma; margin: 0px; padding: 0px 0px 11px; color: rgb(23, 20, 17);&quot;&gt;\n	&lt;font face=&quot;Arial&quot; size=&quot;2&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Высокая чувствительность и колоссальная прочность Mega, о которых наши рыболовы знают не понаслышке, объясняются в ряду других факторов еще и сочетанием графитовых материалов средней и высокой модульности в различных частях бланка. Можно с уверенностью утверждать, что эта серия &ndash; эталон качества для удилищ со стоимостью порядка 100 долларов (система ценовой градации на &laquo;до&raquo; и &laquo;после&raquo; 100 USD получила широкое распространение среди нашей рыболовной общественности). Кстати, при сравнении Mega с другими моделями, не забывайте обращать внимание на место их производства и, если удилище сделано далеко от дома владельца торговой марки, смело делите его цену как минимум пополам прежде, чем сравнить с Mega BANAX.&lt;/font&gt;&lt;/p&gt;\n&lt;p style=&quot;line-height: 1.4; font-family: Tahoma; margin: 0px; padding: 0px 0px 11px; color: rgb(23, 20, 17);&quot;&gt;\n	&lt;font face=&quot;Arial&quot; size=&quot;2&quot;&gt;&amp;nbsp;&amp;nbsp; Фирма Banax уже давно и прочно заняла свою нишу на рыболовном рынке России. Модель MЕGA любима многими спиннингистами.&lt;/font&gt;&lt;/p&gt;\n&lt;p&gt;\n	&amp;nbsp;&lt;/p&gt;\n','','',''),(737,2,' Technium  Tribal  Line 300m 0.35, жилка SHIMANO ind metal box','&lt;p&gt;\n &lt;strong&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Производитель:Shimano&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;\n &lt;strong&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Артикул/модель: Technium Tribal Line&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;\n &lt;strong&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;&lt;strong&gt;&amp;nbsp;&lt;/strong&gt;&lt;/span&gt;&lt;/strong&gt;&lt;strong&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;Характеристики и размеры:&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n&lt;table border=&quot;2&quot; style=&quot;height: 75px; width: 400px;&quot;&gt;\n &lt;tbody&gt;\n  &lt;tr&gt;\n   &lt